import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({imageUrl, box}) => {
	const face = [];
	face.push(box);
	const multipleBoxes = () => {
		if (face) {
		const boundingBox = face.map(border => {
			return (
						<div 	
						className='bounding-box' 
						style={{
							top: border.topRow,
							right: border.rightCol,
							bottom: border.bottomRow,
							left:border.leftCol}}>
						</div>
		)
		})
		return boundingBox;
	}
	return null;
	}

	return (
	<div className='center'>
		<div className='absolute mt5'>
			<img 
			className='shadow-5 ' 
			id='inputimage' 
			alt='Insert correct URL' 
			src={imageUrl} 
			style={{position:'relative', maxWidth: 300, height: 'auto'}} />
			{multipleBoxes()}

			</div>
	</div>

		);
}

export default FaceRecognition;
